import GetImageData from '../utils/GetImageData';
import Button from 'react-bootstrap/Button';
import { useEffect } from "react";

const SurveyPart2 = () => {
    var userData = undefined;

    useEffect(() => {
        if(sessionStorage.getItem('rankData') == null) {
            userData = ["A","B","C"];
            window.sessionStorage.setItem('rankData', JSON.stringify(userData));
        }
        else {
            userData = JSON.parse(window.sessionStorage.getItem('rankData'));
        }
        setSelectData();       
      },[])

    function Next() {
        document.getElementById("SurveyPart2").style.display = "none";
        document.getElementById("SurveyPart3").style.display = "inline";   
       
    }

    function Previous() {
        document.getElementById("SurveyPart1").style.display = "inline";
        document.getElementById("SurveyPart2").style.display = "none";
    }

    function saveData() {
        userData[0] = document.getElementById("rank-one").value;
        userData[1] = document.getElementById("rank-two").value;
        userData[2] = document.getElementById("rank-three").value;
        window.sessionStorage.getItem('rankData', JSON.stringify(userData));
    }

    function setSelectData() {
        document.getElementById("rank-one").value = userData[0];
        document.getElementById("rank-two").value =  userData[1];
        document.getElementById("rank-three").value =  userData[2];
    }

    return (
        <div id="SurveyPart2">
            <div>
                <h1>Del 2</h1>
            <br>
            </br>
            <br>
            </br>
            </div>
            <div className="row">
                <div style={{float: "left", width: "50%"}}>
                    <div id="A">
                    <h2 style={{display: "inline"}}>A</h2>  
                    <img src={GetImageData(0)[0]} width="125" height="125" style={{marginLeft: "10px", marginBottom: "20px"}}></img>
                    <img src={GetImageData(1)[0]} width="125" height="125" style={{marginLeft: "10px", marginBottom: "20px"}}></img>
                    <img src={GetImageData(2)[0]} width="125" height="125" style={{marginLeft: "10px", marginBottom: "20px"}}></img>         
                    </div>
                    <div id="B">
                    <h2 style={{display: "inline"}}>B</h2>    
                    <img src={GetImageData(0)[0]} width="125" height="125" style={{marginLeft: "10px", marginBottom: "20px"}}></img>
                    <img src={GetImageData(1)[0]} width="125" height="125" style={{marginLeft: "10px", marginBottom: "20px"}}></img>
                    <img src={GetImageData(2)[0]} width="125" height="125" style={{marginLeft: "10px", marginBottom: "20px"}}></img>                        
                    </div>
                    <div id="C">
                    <h2 style={{display: "inline"}}>C</h2>    
                    <img src={GetImageData(0)[0]} width="125" height="125" style={{marginLeft: "10px", marginBottom: "20px"}}></img>
                    <img src={GetImageData(1)[0]} width="125" height="125" style={{marginLeft: "10px", marginBottom: "20px"}}></img>
                    <img src={GetImageData(2)[0]} width="125" height="125" style={{marginLeft: "10px", marginBottom: "20px"}}></img>
                    <br>
                    </br>
                    <br>
                    </br>            
                    </div>
                </div>
                <div style={{float: "left", width: "50%"}}>
                    <p style={{textAlign: "center"}}>Varje bokstav motsvarar en typ av förklaring. Rangordna förklaringarna från ett till tre baserat på vilken förklaring <br></br>som du känner <b>mest tillit</b> till.</p>
                    <div style={{textAlign: "center"}}>
                        <div style={{marginBottom: "30px", textAlign: "center"}}>
                            <h4 style={{display: "inline", marginRight: "20px"}}>1.</h4>
                            <select id="rank-one"  style={{width: "100px"}} onchange={saveData()}>
                                <option value="A" style={{textAlign: "right"}}>A</option>
                                <option value="B" style={{textAlign: "right"}}>B</option>
                                <option value="C" style={{textAlign: "right"}}>C</option>     
                            </select>
                        </div>
                        <div style={{marginBottom: "30px", textAlign: "center"}} onchange={saveData()}>
                        <h4 style={{display: "inline", marginRight: "20px"}}>2.</h4>
                            <select id="rank-two"  style={{width: "100px"}}>
                                <option value="B" style={{textAlign: "right"}}>B</option>
                                <option value="C" style={{textAlign: "right"}}>C</option>
                                <option value="A" style={{textAlign: "right"}}>A</option>   
                            </select>
                        </div>
                        <div style={{marginBottom: "30px", textAlign: "center"}} onchange={saveData()}>
                        <h4 style={{display: "inline", marginRight: "20px"}}>3.</h4>
                        <select id="rank-three"  style={{width: "100px"}}>
                                <option value="C" style={{textAlign: "right"}}>C</option>
                                <option value="A" style={{textAlign: "right"}}>A</option>
                                <option value="B" style={{textAlign: "right"}}>B</option>    
                            </select>  
                        </div>
                    </div>
                    <div style={{textAlign: "center"}}>
                        <br>
                        </br>
                        <br>
                        </br>
                        <Button id="Previous-button" style={{ marginBottom: "20px", marginRight: "20px", width: "80px"}} variant="outline-secondary" onClick={Previous}>Tillbaka</Button>
                        <Button id="Next-button" style={{ marginBottom: "20px", marginLeft: "20px", width: "80px"}} variant="outline-secondary"onClick={Next}>Nästa</Button>       
                    </div>
                </div>
            </div>                         
        </div>
    )
}

export default SurveyPart2;
